function Awards () {        
    return (
        <section className="section" id="awards">
        <div class="container">
        <h1 className="title">Awards</h1>
        <Grid container spacing={1} justify="center">
          {Resume.Awards.map((data, i) => (
            <AwardCard award={data} key={i}/>
          ))}
        </Grid>
        </div>
        </section>
    )
}
export default Awards;
